import React from "react";
import Inventory from "../../Data/inventory.json";
import Footer from "../Footer";

export default function ProductList() {
  {
    const images = Inventory.map(({ images }) => images);
    images.map(({ back }) => {
      return (
        <div>
          <img key={Inventory.sku} src={back} />
        </div>
      );
    });
  }
}
